int main(void){
    long long i,j,n,m,k,a,b,c,h,w,r=0,l,t;
    long long da[1024],db[1024];
    long long cv[1024],na,nb;
    rs g[1024];
    mkj x[1024];
    scanf("%lld",&n);
    if(n==2){printf("1 2\n");return 0;}
    for(i=0;i<n-1;i++){
      scanf("%lld%lld",&a,&b);
      g[2*i].st=a;
      g[2*i].fi=b;
      g[2*i].kr=1;
      g[2*i+1].st=b;
      g[2*i+1].fi=a;
      g[2*i+1].kr=1;
    }
    qsort(g,2*(n-1),sizeof(g[0]),sortfnc);
    makemkj(g,x,2*(n-1));
    a=llinf;b=llinf;
    for(i=1;i<=n;i++){
        for(j=0;j<=n;j++){da[j]=llinf;cv[j]=0;}
        dfs(i,0,da,g,x);
        w=0;
        for(j=1;j<=n;j++){
            cv[da[j]]=llmax(x[j].kz,cv[da[j]]);
            w=llmax(w,da[j]);
        }
        w++;
        l=cv[0];
        for(j=1;j<w-1;j++){
            l*=(cv[j]-1);
        }
        //printf("%lld %lld %lld\n",i,w,l);
        if(w>a){continue;}
        if(w==a){b=llmin(b,l);}
        else{a=w;b=l;}
    }
    for(i=0;i<2*(n-1);i++){
        if(g[i].st>g[i].fi){continue;}
        for(j=0;j<=n;j++){da[j]=llinf;db[j]=llinf;cv[j]=0;}
        dfs(g[i].st,0,da,g,x);
        dfs(g[i].fi,0,db,g,x);
        w=0;
        for(j=1;j<=n;j++){
            t=llmin(da[j],db[j]);
            cv[t]=llmax(x[j].kz,cv[t]);
            w=llmax(w,t);
        }
        w++;
        l=2*(cv[0]-1);
        for(j=1;j<w-1;j++){
            l*=(cv[j]-1);
        }
        //printf("%lld %lld %lld %lld\n",g[i].st,g[i].fi,w,l);
        if(w>a){continue;}
        if(w==a){b=llmin(b,l);}
        else{a=w;b=l;}
    }
    printf("%lld %lld\n",a,b);
    return 0;
}
